INSERT INTO `christian_content` (`id`, `asset_id`, `title`, `alias`, `title_alias`, `introtext`, `fulltext`, `state`, `sectionid`, `mask`, `catid`, `created`, `created_by`, `created_by_alias`, `modified`, `modified_by`, `checked_out`, `checked_out_time`, `publish_up`, `publish_down`, `images`, `urls`, `attribs`, `version`, `parentid`, `ordering`, `metakey`, `metadesc`, `access`, `hits`, `metadata`, `featured`, `language`, `xreference`) VALUES
(1, 40, 'Welcome', 'newcomers-welcome', '', '<p> </p>\r\n<p>I like the silence of a church, before the service begins better than any preaching.</p>\r\n<h2>-Ralph Waldo Emerson</h2>\r\n<p>You can be committed to Church but not committed to Christ, but you cannot be committed to Christ and not committed to church.</p>\r\n<h2>– Joel Osteen</h2>\r\n<p>I think if the church did what they were supposed to do we wouldn’t have anyone sleeping on the streets.</p>\r\n<h2>– Michael W. Smith</h2>\r\n<p>“I believe there are too many practitioners in the church who are not believers.”</p>\r\n<h2>- C. S. Lewis</h2>\r\n<p>“You may speak but a word to a child, and in that child there may be slumbering a noble heart which shall stir the Christian Church in years to come.”</p>\r\n<h2>- Charles Spurgeon</h2>\r\n<p>“What the Church needs to-day is not more machinery or better, not new organizations or more and novel methods, but men whom the Holy Ghost can use — men of prayer, men mighty in prayer. The Holy Ghost does not flow through methods, but through men. He does not come on machinery, but on men. He does not anoint plans, but men, men of prayer.”</p>\r\n<h2>- E. M. Bounds</h2>', '', 1, 0, 0, 2, '2013-03-22 12:38:18', 135, '', '2013-03-22 12:48:47', 135, 135, '2013-03-22 12:48:47', '2013-03-22 12:38:18', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"1","link_titles":"1","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 8, 0, 0, '', '', 1, 2, '{"robots":"","author":"","rights":"","xreference":""}', 1, '*', '');
